import Dialog from "@mui/material/Dialog";
import { MdClose } from "react-icons/md";
import Button from "@mui/material/Button";
import Rating from "@mui/material/Rating";
import { useState } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Zoom from "react-medium-image-zoom";
import "react-medium-image-zoom/dist/styles.css";

const ProductModel = ({ open, onClose }) => {
  const images = [
    "", 
    "https://via.placeholder.com/300", 
    "https://via.placeholder.com/300"
  ];

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Dialog open={open} onClose={onClose} className="productModal">
      <div className="modal-content">
        <Button className="close_" onClick={onClose}>
          <MdClose />
        </Button>
        <h2>Product Details</h2>
        <div className="d-flex align-items-center">
          <div className="d-flex align-items-center">
            <span>Brand:</span>
            <span className="m-2">Welch's</span>
          </div>
          <Rating name="read-only" value={5} size="small" precision={0.5} readOnly />
        </div>
        <hr />
        <div className="row mt-2 ProductDetailModal">
          <div className="col-md-5">
            <Slider {...settings}>
              {images.map((img, index) => (
                <div key={index}>
                  <Zoom>
                    <img src={img} alt={`Product ${index + 1}`} style={{ width: "100%", cursor: "zoom-in" }} />
                  </Zoom>
                </div>
              ))}
            </Slider>
          </div>
          <div className="col-md-7">
            {/* Additional product details can go here */}
          </div>
        </div>
      </div>
    </Dialog>
  );
};

export default ProductModel;
